import React, { useEffect, useState } from 'react'

function Master(){
  const [comics, setComics] = useState([])
  useEffect(() => {
    async function getComics(){
      const response = await fetch('http://localhost:8000/api/comics', { headers: { 'content-type':'application/json'}})
      const data: Promise<[]> = response.json()
      setComics(() => data)
    }

  })
  return (
    <h1>Master</h1>
  )
}

export default Master
